import hashlib
import base64
from io import BytesIO
from PIL import Image, ImageTk


def get_last_backup_time(backup_dir):
    """Recuperar a hora do último backup de um arquivo."""
    last_backup_file = os.path.join(backup_dir, 'tempo_do_ultimo_backup.txt')
    if os.path.exists(last_backup_file):
        with open(last_backup_file, 'r') as file:
            return datetime.fromisoformat(file.read().strip())
    return None


def count_total_files(source_dir):
    """Contar o número total de arquivos no diretório e subdiretórios."""
    total_files = 0
    contador =-1



    for _, _, filenames in os.walk(source_dir):
        contador=contador+1
        if(contador==0):
            status_label.config(text="Processando.")
            root.update_idletasks()  # Atualiza a interface visualmente   
        if(contador==1):
            status_label.config(text="Processando..")
            root.update_idletasks()  # Atualiza a interface visualmente                   
        if(contador==3):
            status_label.config(text="Processando...")
            root.update_idletasks()  # Atualiza a interface visualmente                   
        else:
            contador=-1

        status_copiado.config(text="Análise: "+str(source_dir))
        root.update_idletasks()  # Atualiza a interface visualmente  

        total_files += len(filenames)
        if ((total_files%1000)==0):
            print(f'\r {str(total_files)} arquivos processados. Aguarde...\n', end='')	


    status_copiado.config(text="")
    root.update_idletasks()  # Atualiza a interface visualmente 
    #print(f'\rProgresso: {progress:.2f}%', end='')			
       
    return total_files


def set_last_backup_time(backup_dir):
    """Salve a hora atual como a hora do último backup."""
    last_backup_file = os.path.join(backup_dir, 'tempo_do_ultimo_backup.txt')
    with open(last_backup_file, 'w') as file:
        file.write(datetime.now().isoformat())

def backup_modified_files(source_dir, backup_dir):
    """Arquivos de backup modificados desde o último backup, preservando a estrutura de diretórios."""
    last_backup_time = get_last_backup_time(backup_dir)
    if last_backup_time is None:
        last_backup_time = datetime.min


    error_files = []
    total_files = count_total_files(source_dir)
    processed_files = 0

    start_time = datetime.now()


    for foldername, subfolders, filenames in os.walk(source_dir):
        rel_path = os.path.relpath(foldername, source_dir)
        backup_subdir = os.path.join(backup_dir, rel_path)
        if not os.path.exists(backup_subdir):
            os.makedirs(backup_subdir)


		
        for filename in filenames:

            try:
                source_file = os.path.join(foldername, filename)
                backup_file = os.path.join(backup_subdir, filename)
				

                print(f'\rVerificando caminho: {backup_file}. Aguarde...\n', end='')	
                status_copiado.config(text="Análise: "+str(filename))
                root.update_idletasks()  # Atualiza a interface visualmente   

                if datetime.fromtimestamp(os.path.getmtime(source_file)) > last_backup_time:
                    shutil.copy2(source_file, backup_file)
                   # print(f'Backup atualizado para: {filename}')
                   
                    status_copiado.config(text="Copiado: "+str(filename))
                    
                    root.update_idletasks()  # Atualiza a interface visualmente                    
                # Atualizar o contador de arquivos processados e mostrar progresso
                processed_files += 1
                progress = (processed_files / total_files) * 100
                #print(f'\rProgresso: {progress:.2f}%', end='')

                status_label.config(text="Progresso: "+str(round(progress))+"%")
				
                #print(source_file)
               
                root.update_idletasks()  # Atualiza a interface visualmente

            except:
                print(f'Erro de permissão: não foi possível copiar {source_file}')		
                error_files.append(source_file)				
                pass


    print(f'\rVerificando caminho: {backup_file}. Aguarde...\n', end='')	
    
    status_copiado.config(text="")
    # Atualiza a data do último backup
    set_last_backup_time(backup_dir)
    messagebox.showinfo("Backup Concluído", "O backup foi concluído com sucesso.")
	
    #print(error_files)
	
    # Atualiza a data do último backup
    set_last_backup_time(backup_dir)
    # Calcular e exibir a duração do backup
    end_time = datetime.now()
    duration = end_time - start_time
    duration_in_s = duration.total_seconds()
    hours, remainder = divmod(duration_in_s, 3600)
    minutes, seconds = divmod(remainder, 60)
    print(error_files)
    print(f'\nBackup concluído em {int(hours)} horas, {int(minutes)} minutos e {int(seconds)} segundos.')   	

def select_source_directory():
    directory = filedialog.askdirectory()
    source_entry.delete(0, tk.END)
    source_entry.insert(0, directory)

def select_backup_directory():
    directory = filedialog.askdirectory()
    backup_entry.delete(0, tk.END)
    backup_entry.insert(0, directory)

def start_backup():


    source_directory = source_entry.get()
    backup_directory = backup_entry.get()
    
    if not os.path.isdir(source_directory):
        messagebox.showerror("Erro", "O caminho do diretório de origem não existe. Por favor, verifique e tente novamente.")
    elif not os.path.isdir(backup_directory):
        messagebox.showerror("Erro", "O caminho do diretório de backup não existe. Por favor, verifique e tente novamente.")
    else:
        backup_modified_files(source_directory, backup_directory)

